        allWisdom.add(Wisdom("ليس من بعد العسر إلا اليسر، ولا يغلق الله بابًا إلا و يفتح خيرًا منه، وإن ضاق بك الحال فتذكر أن غيرك يحلم ببعضه نتظر شيئاً من أحد، ولا يتوقع شيئاً من أحد، ولا يحصر تطلعاته في أحنتظر شيئاً من أحد، ولا يتوقع شيئاً من أحد، ولا يحصر تطلعاته في أحنتظر شيئاً من أحد، ولا يتوقع شيئاً من أحد، ولا يحصر تطلعاته في أحنتظر شيئاً من أحد، ولا يتوقع شيئاً من أحد، ولا يحصر تطلعاته في أحنتظر شيئاً من أحد، ولا يتوقع شيئاً من أحد، ولا يحصر تطلعاته في أح على كل شيء."))
        allWisdom.add(Wisdom("أبتسم ولو القلب يقطر دماً ،اعطي كثيراً ولو حُورمت  ،توقع خيراً مهما كثر البلاء ،لاتكره أحداً مهما أخطأ في حقك ، عش في بساطه مهما علا شأنك."))
        allWisdom.add(Wisdom("التفكير الزائد في خيبات الماضي يجعل حياتك كئيبة جدآ لا تقتل لحظتك بالتحسر ، عش حياتك سعيداً فالأيام لا تعود ."))

        allWisdom.add(Wisdom("لو ضربت طفلاً ضربة خفيفة و أنت توبّخه لبكى ولو ضربته ضربة أقوى منها وأنت تمازحه لضحك ، فالألم المعنوي أشد إيذاءً من الألم الجسدي."))

